function App() {

const fetchProducts = async () => {
        const results = await axios.get('http://localhost:8000/products')
        console.log('fetchProducts', results)
        debugger;
        const {products} = results.data
        return products;
    }



  return (
    <div>
      <h1>hello world</h1>
    <SearchBar/>
    <ProductList/>
    </div>
  );
}

export default App;
